import React, {Fragment} from "react";
import ShiftTable from "./ShiftTable/ShiftTable";


const DisplayShifts = (props) => {


    return (
        <Fragment>
            {props.shift &&
                props.getAllShiftsProperty.map((shift, index) => {
                    return(
                        <tr className="form-control" key={shift.id}>
                            <ShiftTable shift={shift}/>
                        </tr>
                    )
                    }
            )}
        </Fragment> 
    );
}
 
export default DisplayShifts;
